import React from "react";

const App: React.FC = () => {
  return (
    <div className="flex-row justify-center h-screen bg-gray-100 mx-2">
      <h2 className="text-2xl font-bold py-8 leading-7 text-gray-900 sm:truncate sm:text-3xl sm:tracking-tight">
        Welcome to Agnos Health Check
      </h2>
      <div className="flex justify-center">
        <p className="place-self-center"> Please select the pain area</p>
        <img
          className="max-w-screen-sm"
          src="/images/default-abs.png"
          alt="default-abs"
        />
      </div>
    </div>
  );
};

export default App;
